A solução proposta consiste na contratação de empresa especializada em serviços de manutenção de sistemas de telefonia PABX, visando restabelecer a plena funcionalidade da central de comunicação da Unidade P1 do Complexo Penal de Potim.
A execução dos serviços incluirá:
Diagnóstico técnico completo da Central de PABX, com identificação de falhas nos ramais internos e na linha externa;
Realização de manutenção corretiva, com substituição de placas e componentes danificados, garantindo a compatibilidade com o sistema já instalado;
Fornecimento de peças necessárias, em especial placas para troncos analógicos, assegurando a reposição adequada para o funcionamento da central;
Testes operacionais e homologação, de modo a garantir que todos os ramais internos e linhas externas estejam em pleno funcionamento após a intervenção;
Prazo máximo de execução de 10 (dez) dias a contar da assinatura do contrato.
A adoção desta solução permitirá a recuperação integral do sistema de comunicação telefônica da unidade prisional, assegurando:
Atendimento contínuo às demandas de órgãos do sistema de justiça, fornecedores e familiares de sentenciados;
Comunicação eficiente entre os setores internos;
Redução de riscos operacionais decorrentes da interrupção das comunicações;
Custo reduzido em relação à substituição integral da central, mantendo a infraestrutura já existente.
Dessa forma, a solução apresenta-se como tecnicamente adequada, economicamente vantajosa e imprescindível para a continuidade das atividades administrativas e de segurança da Unidade P1.

Aquisição de materiais classificados de natureza permanente, sendo, 07 unidades de NVR (Network Video Recorders) de 32 canais - Hikvision com IA.
