Cada NVR deverá possuir, no mínimo:
- Suporte para 32 canais IP;
- Compatibilidade com câmeras de até 8MP;
- Capacidade para múltiplos HDs (mínimo 2 SATA);
- Interface de rede Gigabit Ethernet;
- Acesso remoto via aplicativo e navegador;
- Suporte a RAID (preferencial);
- Fonte redundante (preferencial para ambientes críticos);
- Compatibilidade com o sistema atual de câmeras e software de monitoramento.

